import React from "react";
import { ContentDiv } from "../styledComponents";
import Image1_1_A from "../img/image 1.png";

const Content = () => {
  return (
    <ContentDiv>
      <div className="contentWrapper">
        <div className="questionBox">
          <h1>Q1</h1>
          <p>학창시절에 주로 뭐할 때가 제일 좋았어?</p>
        </div>
        <div className="answerBox">
          <div className="ans ans1">
            <h1>A</h1>
            <img alt="answer1"></img>
            <p>난 친구들이랑 함께 있는게 제일 좋았지!</p>
          </div>
          <div className="ans ans2">
            <h1>B</h1>
            <img alt="answer2"></img>
            <p>혼자 인터넷이나 게임하는게 좋았어</p>
          </div>
        </div>
      </div>
    </ContentDiv>
  );
};

export default Content;
